@Олег Козырь Я специально написал такой длинный текст, чтобы объяснить, что закон ничего не отменяет, потому что противоречия со ст. 136 нет. Суть 136-й в том, что для принятия достаточно одобрения правительства. И оно получено. То есть, поправки приняты. Поэтому никакого противоречия нет.

Но то, что они приняты, не означает, что все поправки вступили в силу (см. снова мой пример в предыдущем комментарии). На данный момент это такие как бы "спящие поправки". Они есть, но они бездействуют. Чтобы они начали реально действовать, нужно чтобы проголосовало "за" больше 50%.

Я понимаю, что всё это жуткая казуистика. Что сам закон не должен быть таким. Что Конституционный Суд не должен был это всё одобрять. Но тем не менее, с чистой юридической точки зрения противоречия нет (если только КС не зарубил бы этот закон, но он этого не сделал). То есть формально всё по закону.

@Verber Ev Да, он так сказал. Но что от этого меняется? Утверждать, что соответствует Коституции, а что нет, может только КС. Сторонники бойкота живут в своём выдуманном мире, где они самостоятельно могут решать вопросы законности. Помните как в 18 году Навальный хотел оспорить в КС Закон о выборах, где содержался расширенный перечень обстоятелств, препятствующих выдвижению в президенты? КС отказал ему в удовлетворении жалобы. А что сделали Навальный и его сторонники? Вынуждены были этому подчиниться. Потому что это государство и только ему решать, что законно, а что нет. 
И, кстати, вы же можете быть не согласны с некоторыми положениями УК, но что, они от этого перестают действовать (в т.ч. и в отношении вас)?😀
Бойкот - это ребячество. Сам в 18 году был сторонников Навального и участвовал в бойкоте и наблюдении. Сейчас понимаю, что это была провальная тактика и нужно было голосовать за менее нам противного кандидата.

