@Паша Исмаилов Статья 3 Конституции говорит, что высшим непосредственным выражением власти народа являются референдум и свободные выборы. А что такое «общероссийское голосование»? Нигде не сказано, что оно является выражением власти народа.Но законодатели не называют его референдумом по вполне понятной причине: предлагаемые правила его проведения сильно расходятся с нормами Федерального конституционного закона «О референдуме Российской Федерации». Поэтому и придумали новую сущность, Конституцией не предусмотренную.

Российское законодательство содержит довольно обширные гарантии прав граждан на участие в референдуме — и граждане их лишаются. А эти гарантии касаются и проверки вопроса, выносимого на референдум, и правил агитации за и против, и правил финансирования такой агитации, и порядка проведения голосования и подсчета голосов под наблюдением представителей разных политических сил, и ответственности за нарушение закона. Вместо этого депутаты наспех придумали коротенькие правила проведения голосования и запихнули их во вторую статью закона о поправках.

Подробно процедура голосования должна быть прописана в документе, который называется «Порядок подготовки и проведения общероссийского голосования» и который должна принять ЦИК. В том проекте, который уже принят ЦИК за основу, сильно усечены многие нормы, которые есть в законах о выборах и референдумах и которые обеспечивают контроль за проведением голосования. В первую очередь это касается контроля за досрочным голосованием и голосованием на дому. На это обращали внимание несколько экспертов при обсуждении проекта в Центризбиркоме. Что решит в конечном счете ЦИК, неизвестно, но пока желания обеспечить такой контроль не заметно.

